var p=$('clsa-inhome.InHome_Id:QuestionnaireMetric.missingCount').asSequence()
var q=$('clsa-inhome.InHome_Id:QuestionnaireMetric.questionCount').asSequence()
var res=null
if(p.isNull().and(q.isNull()).not().value() && 0!=q.sum()){
  var str=[]
  str.push(
    'complete:'+
    Math.round(q.sum().minus(p.sum()).multiply(100).div(q.sum()).value()))

var sections={
'AGE':[
'AGE_DOB_COM',
'AGE_CALC_COM',
'AGE_ASK_COM',
'AGE_DIS_OVERRIDE_COM',
'AGE_DIS_OVERRIDE_RSN_COM_Q'],
'SEX':[
'SEX_ASK_COM']
}

  for(var key in sections) {
    var rcount=0
    var qcount=0
    var arr=sections[key]
    for(var i=0; i<arr.length; i++ ) {
      var j=$('clsa-inhome.InHome_Id:'+arr[i])
      if(j.isNull().value()) continue
      qcount++
      rcount+=j.any('REFUSED').value()?1:0
    }
    if(0==qcount) {
      str.push(key+':100')
    } else {
      var perc=100.0*rcount/qcount
      if(0<perc && 100>perc && 0!=(perc-Math.floor(perc))) {
        perc=perc.toFixed(3)
      }
      str.push(key+':'+perc)
    }
  }

  res=newValue('{'+str.join(',')+'}','text')
}
res

